import{_ as a,v as e,b as t,R as r}from"./chunks/framework.eea9f507.js";const u=JSON.parse('{"title":"Q&A","description":"","frontmatter":{},"headers":[],"relativePath":"others/Q&A.md","filePath":"others/Q&A.md"}'),o={name:"others/Q&A.md"},i=r('<h1 id="q-a" tabindex="-1">Q&amp;A <a class="header-anchor" href="#q-a" aria-label="Permalink to &quot;Q&amp;A&quot;">​</a></h1><h2 id="q-软件安装时提示需要更新webview2" tabindex="-1">Q：软件安装时提示需要更新webview2 <a class="header-anchor" href="#q-软件安装时提示需要更新webview2" aria-label="Permalink to &quot;Q：软件安装时提示需要更新webview2&quot;">​</a></h2><p>A：系统不支持webview2，需要打开windows更新，对系统进行更新。</p><h2 id="q-为什么有些算子单步执行时间-比程序全速运行的时间长" tabindex="-1">Q：为什么有些算子单步执行时间，比程序全速运行的时间长 <a class="header-anchor" href="#q-为什么有些算子单步执行时间-比程序全速运行的时间长" aria-label="Permalink to &quot;Q：为什么有些算子单步执行时间，比程序全速运行的时间长&quot;">​</a></h2><p>A：目前版本(0.1.0)的程序仍是串行处理，每个算子都要等前一个算子的结果返回后才会执行。单步运行时，由于时间间隔长，对算子执行不影响，全速运行就需要等待了。</p><h2 id="q-为什么程序执行到一半出错了之后不能再打开算子编辑界面" tabindex="-1">Q：为什么程序执行到一半出错了之后不能再打开算子编辑界面 <a class="header-anchor" href="#q-为什么程序执行到一半出错了之后不能再打开算子编辑界面" aria-label="Permalink to &quot;Q：为什么程序执行到一半出错了之后不能再打开算子编辑界面&quot;">​</a></h2><p>A：目前版本(0.1.0)AIV算子编辑界面在程序运行过程中是禁用的，程序没有执行完出错，需要手动点击&quot;清除运行记录&quot;按钮，来空运行状态。</p><h2 id="q-为什么更换工程后-新工程的第一个捕捉图像工具打开后仍会显示上个工程的图像" tabindex="-1">Q：为什么更换工程后，新工程的第一个捕捉图像工具打开后仍会显示上个工程的图像 <a class="header-anchor" href="#q-为什么更换工程后-新工程的第一个捕捉图像工具打开后仍会显示上个工程的图像" aria-label="Permalink to &quot;Q：为什么更换工程后，新工程的第一个捕捉图像工具打开后仍会显示上个工程的图像&quot;">​</a></h2><p>A：目前版本(0.1.0)每打开一次AIV软件，图像会保存在系统的一个缓存目录，更换工程后，不会更换该目录，也不会删除目录中的图像，因此新工程仍能看到老工程的图像。不影响程序运行。</p><h2 id="q-主页面上删除im显示按钮后-再增加无法恢复原有的im编号" tabindex="-1">Q：主页面上删除IM显示按钮后，再增加无法恢复原有的IM编号 <a class="header-anchor" href="#q-主页面上删除im显示按钮后-再增加无法恢复原有的im编号" aria-label="Permalink to &quot;Q：主页面上删除IM显示按钮后，再增加无法恢复原有的IM编号&quot;">​</a></h2><p>A：目前版本(0.1.0)未对IM编号进行管理，开发人员建议不要删除IM窗口，如误操作，可以重新启动软件。</p><h2 id="q-程序运行时-某些算子-如3d位置转换-执行完后-图像显示框会存在重叠的点云" tabindex="-1">Q：程序运行时，某些算子(如3D位置转换)执行完后，图像显示框会存在重叠的点云 <a class="header-anchor" href="#q-程序运行时-某些算子-如3d位置转换-执行完后-图像显示框会存在重叠的点云" aria-label="Permalink to &quot;Q：程序运行时，某些算子(如3D位置转换)执行完后，图像显示框会存在重叠的点云&quot;">​</a></h2><p>A：目前版本(0.1.0)图像显示存在延时及某个尚未解决的问题，导致图像重叠，但仅影响界面的显示，算子处理不受影响。</p><h2 id="q-单步运行时-某个算子执行完结果和时间都没有显示" tabindex="-1">Q：单步运行时，某个算子执行完结果和时间都没有显示 <a class="header-anchor" href="#q-单步运行时-某个算子执行完结果和时间都没有显示" aria-label="Permalink to &quot;Q：单步运行时，某个算子执行完结果和时间都没有显示&quot;">​</a></h2><p>A：目前版本(0.1.0)上一个算子没有执行完，就点击单步运行，会导致程序跳过当前算子，所以没有执行。</p><h2 id="q-为什么有些算子全速运行时报错-单步运行没有报错" tabindex="-1">Q：为什么有些算子全速运行时报错，单步运行没有报错 <a class="header-anchor" href="#q-为什么有些算子全速运行时报错-单步运行没有报错" aria-label="Permalink to &quot;Q：为什么有些算子全速运行时报错，单步运行没有报错&quot;">​</a></h2><p>A：目前版本(0.1.0)以单步运行为准。</p>',17),h=[i];function s(n,d,l,q,c,p){return e(),t("div",null,h)}const m=a(o,[["render",s]]);export{u as __pageData,m as default};
